import { useState } from 'react';
import './App.css';
import SubmitForm from './components/SubmitForm';

function App() {
  const [formData, setFormData] = useState([]);
  return (
    <div className="App">
      <SubmitForm formData={formData} setFormData={setFormData}/>

      <table>
        <thead>
          <tr>
            <th>이름</th>
            <th>가격</th>
            <th>유형</th>
            <th>구입 날짜</th>
            <th>메모</th>
            <th>재구매 의사</th>
          </tr>
        </thead>
        <tbody>
          {formData.map(item => (
            <tr key={item.id}>
              <td>{item.name}</td>
              <td>{item.price}</td>
              <td>{item.category}</td>
              <td>{item.date}</td>
              <td>{item.memoText}</td>
              <td>{item.repurchase}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
